import React from 'react';

const trendsData = [
    { id: 1, title: 'Trend 1', description: 'Description of trend 1' },
    { id: 2, title: 'Trend 2', description: 'Description of trend 2' },
    { id: 3, title: 'Trend 3', description: 'Description of trend 3' },
    // Add more trends as needed
];

function Trends() {
    return (
        <div className="trends">
            <h1>Market Trends</h1>
            <ul className="trends-list">
                {trendsData.map(trend => (
                    <li key={trend.id} className="trend-item">
                        <h2>{trend.title}</h2>
                        <p>{trend.description}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Trends;
